import React from "react";
import { Route } from "react-router";
import ghidorahList from "../../lists/ghidorahList";
import GhidorahPath from "./ghidorahPathname";

const GhidorahRouter = () => {
  for (let i = 0; i < ghidorahList.length; i++) {
    return (
      <Route
        path={"/ghidorah-list" + ghidorahList[i].link}
        component={GhidorahPath}
      />
    );
  }
};

export default GhidorahRouter;
